-module(syntax_abstract_SUITE).

-compile(export_all).

-include_lib("common_test/include/ct.hrl").
-include_lib("eunit/include/eunit.hrl").

%%--------------------------------------------------------------------
%% COMMON TEST CALLBACK FUNCTIONS - SUITE
%%--------------------------------------------------------------------

suite() ->
    [
        {timetrap, {minutes, 10}}
    ].

init_per_suite(Config) ->
    Config.

end_per_suite(_Config) ->
    ok.

%%--------------------------------------------------------------------
%% COMMON TEST CALLBACK FUNCTIONS - GROUPS - STRUCTURE
%%--------------------------------------------------------------------

groups() ->
    [
        {all_atoms, [], [
            test_atoms_all_single,
            test_atoms_constant,
            test_atoms_count,
            test_atoms_expression_list,
            test_atoms_function_invocation,
            test_atoms_list_comprehension,
            test_atoms_map_literal,
            test_atoms_number_literal_decimal_integer,
            test_atoms_number_literal_decimal_integer_sign,
            test_atoms_number_literal_exponential_decimal,
            test_atoms_number_literal_exponential_decimal_sign,
            test_atoms_number_literal_hex_integer,
            test_atoms_number_literal_hex_integer_sign,
            test_atoms_number_literal_octal_integer,
            test_atoms_number_literal_octal_integer_sign,
            test_atoms_number_literal_regular_decimal,
            test_atoms_number_literal_regular_decimal_sign,
            test_atoms_parameter,
            test_atoms_parenthesized_expression,
            test_atoms_relationships_pattern,
            test_atoms_string_literal,
            test_atoms_variable
        ]},
        {all_clauses, [], [
            test_clause_create,
            test_clause_delete,
            test_clause_match,
            test_clause_merge,
            test_clause_remove,
            test_clause_return,
            test_clause_set,
            test_clause_unwind,
            test_clause_with]},
        {all_complex_queries, [], [
            test_complex_comment,
            test_complex_regular_query,
            test_complex_single_query
        ]},
        {all_expressions, [], [
            test_expressions_2,
            test_expressions_3,
            test_expressions_4,
            test_expressions_5,
            test_expressions_6,
            test_expressions_7,
            test_expressions_8,
            test_expressions_9,
            test_expressions_10,
            test_expressions_11,
            test_expressions_12
        ]},
        {all_patterns, [], [
            test_patterns_all_shortest_paths_pattern,
            test_patterns_node_pattern,
            test_patterns_pattern,
            test_patterns_pattern_element,
            test_patterns_pattern_element_chain,
            test_patterns_pattern_part
        ]}
    ].

%%--------------------------------------------------------------------
%% COMMON TEST CALLBACK FUNCTIONS - GROUPS - INIT
%%--------------------------------------------------------------------

init_per_group(_, Config) ->
    Config.

%%--------------------------------------------------------------------
%% COMMON TEST CALLBACK FUNCTIONS - GROUPS - END
%%--------------------------------------------------------------------

end_per_group(_, _Config) ->
    ok.

%%--------------------------------------------------------------------
%% COMMON TEST CALLBACK FUNCTIONS - ALL
%%--------------------------------------------------------------------

all() ->
    [
        {group, all_atoms},
        {group, all_clauses},
        {group, all_complex_queries},
        {group, all_expressions},
        {group, all_patterns}
    ].

